INSERT INTO `feedback_comment` VALUES (2,'','','','',11),(3,'','','','',93),(4,'','','','',94),(5,'','','','',95),(6,'','','','',96),(7,'','','','',93),(8,'','','','',94),(9,'','','','',95),(10,'','','','',101),(11,'','','','',98),(12,'','','','',100),(13,'','','','',94),(14,'','','','',93),(15,'','','','',98),(16,'','','','',96),(17,'','','','',101),(18,'','','','',95),(19,'','','','',98),(20,'','','','',100),(21,'','','','',101),(22,'','','','',100),(23,'','','','',96),(24,'','','','',93),(25,'','','','',94),(26,'','','','',95),(27,'','','','',96),(28,'','','','',98),(29,'','','','',100),(30,'','','','',101),(31,'','','','',93),(32,'','','','',93),(33,'','','','',94),(34,'The course is very important for computer science students but the teacher is not up to the mark.','He just sits in the class and dont even care to touch the board.','I am sorry to say this but Sir is unable to clear doubts of students.When asked by students he says to do it as home-work or read from books.','',95),(35,'','','','I am sorry to say this but being a teacher of Data Structures and Algorithm our teacher is unable to preform relative grading in the exams.For the past two semesters he has been fooling students by saying that his relative grading graph always matches with the absolute grading range.',96),(36,'No course taught at all!! How can it be organised then? ','Nothing taught!','Nothing taught! So no interaction.. Go to class sit there until its past 50 mins when he goes.','Copies were not even checked. Marks were written just seeing the handwriting and umber of pages infront of the students themselves .',93),(37,'','','','',98),(38,'Most of the syllabus( around 30%) is covered (mostly skipped by writing topics) in the last 2-3 lectures! Very slow during first few lectures. Bad organisation','Unable to explain  things. Gets stuck in middle.','Many topics are taught wrong. When questioned ,we are asked to read it ourselves at room.','The toughness of exams is good. Grading is improper. Relative grading is not followed. Students above 90 are given A , above 80 A- and so on.',96),(39,'','','','',101),(40,'','','','',100),(41,'No organisation. Classes not held regularly. Nothing much taught.','Lacks knowledge and gets stuck when questions are asked.','Nothing much taught.','Copies are not checked properly. In end semester examination, my two questions were checked but not given marks. What if I had not been present to see them and get them corrected.I would have lost a grade due to correction mistake. This is really bad.',95),(42,'','','','',94),(43,'','','','',93),(44,'','','','',94),(45,'','','','',95),(46,'','','','',93),(47,'','','','',96),(48,'','','','',98),(49,'','','','',100),(50,'','','','',101),(51,'','','','',93),(52,'','','','',94),(53,'','','','',95),(54,'','','','',96),(55,'','','','',98),(56,'','','','',100),(57,'','','','',101),(58,'','','','',93),(59,'','','','',94),(60,'','','','',98),(61,'The course was organised very poorly and the most imortant topics in Algorithms, the most difficult ones were given the least time! Often important hard-to-understand algorithms like KMP, hard dynamic programming problems were given as \"home assignments\". The course of Algorithms could not have been more poorly taught.','Presentation was fair. ','There was none to comment about. During class hours, \"meet me after class\", and later \"why don\'t you ask them in class, my office hours are not for wasting time with you.\". Haha, and I thought you couldn\'t explain recursion too.','He has openly flouted the relative grading system, and graded all students according to ',96),(62,'','','','',95),(63,'','','','',96),(64,'','','','',94),(65,'','','','',100),(66,'','','','',101),(67,'','','','',93),(68,'','','','',94),(69,'','','','',95),(70,'','','','',96),(71,'','','','',98),(72,'','','','',100),(73,'','','','',101),(74,'','','','',93),(75,'','','','',94),(76,'','','','',95),(77,'','','','',96),(78,'','','','',98),(79,'','','','',100),(80,'Course was well organised and lecture notes covered almost all the questions in the exams but there seems to be nothing new idea in the exams.','Presentation is excellent. Diagrams on the board are clear.','','',198);
